"use strict";(self.webpackChunktechdocs=self.webpackChunktechdocs||[]).push([[8037],{653:e=>{e.exports=JSON.parse('{"blogPosts":[{"id":"/2024/03/05/docusaurusv3-update","metadata":{"permalink":"/techdocs/blog/2024/03/05/docusaurusv3-update","source":"@site/blog/2024-03-05-docusaurusv3-update.md","title":"Docusaurus v3","description":"Docusaurus was updated to the new major version 3.","date":"2024-03-05T00:00:00.000Z","formattedDate":"March 5, 2024","tags":[],"hasTruncateMarker":false,"authors":[{"name":"Asta86","url":"https://maybelambda.cf","imageURL":"/techdocs/img/l-logo.png","key":"lea"}],"frontMatter":{"title":"Docusaurus v3","authors":"lea"},"unlisted":false,"nextItem":{"title":"New repo URL","permalink":"/techdocs/blog/2024/02/16/renamed-repo"}},"content":"Docusaurus was updated to the new major [version 3](https://docusaurus.io/blog/releases/3.0).\\n\\nThis time luckily only minor document formatting changes were needed to make them fully compatible with the new version of MDX that it uses."},{"id":"/2024/02/16/renamed-repo","metadata":{"permalink":"/techdocs/blog/2024/02/16/renamed-repo","source":"@site/blog/2024-02-16-renamed-repo.md","title":"New repo URL","description":"I renamed my GitLab username to something shorter and was happy to see that the pages domain names were updated automatically in just a moment.","date":"2024-02-16T00:00:00.000Z","formattedDate":"February 16, 2024","tags":[],"hasTruncateMarker":true,"authors":[{"name":"Asta86","url":"https://maybelambda.cf","imageURL":"/techdocs/img/l-logo.png","key":"lea"}],"frontMatter":{"title":"New repo URL","authors":"lea"},"unlisted":false,"prevItem":{"title":"Docusaurus v3","permalink":"/techdocs/blog/2024/03/05/docusaurusv3-update"},"nextItem":{"title":"Using Q4Wine with wine-ge-custom and Proton","permalink":"/techdocs/blog/2023/11/07/q4wine-eggroll"}},"content":"I renamed my GitLab username to something shorter and was happy to see that the pages domain names were updated automatically in just a moment. \\n\\n\x3c!--truncate--\x3e\\n\\nOnly for the base domain (username.gitlab.io) I had to also update the repository path under Settings -> General -> Advanced -> Change path to /newusername.gitlab.io.\\n\\nFinally, I didn\'t face any issues with the deploy pipelines in the new namespace."},{"id":"/2023/11/07/q4wine-eggroll","metadata":{"permalink":"/techdocs/blog/2023/11/07/q4wine-eggroll","source":"@site/blog/2023-11-07-q4wine-eggroll.md","title":"Using Q4Wine with wine-ge-custom and Proton","description":"Lately Q4Wine has been my favorite Wine GUI since it\'s very","date":"2023-11-07T00:00:00.000Z","formattedDate":"November 7, 2023","tags":[],"hasTruncateMarker":true,"authors":[{"name":"Asta86","url":"https://maybelambda.cf","imageURL":"/techdocs/img/l-logo.png","key":"lea"}],"frontMatter":{"title":"Using Q4Wine with wine-ge-custom and Proton","authors":"lea"},"unlisted":false,"prevItem":{"title":"New repo URL","permalink":"/techdocs/blog/2024/02/16/renamed-repo"},"nextItem":{"title":"Docusaurus 2 leaves beta","permalink":"/techdocs/blog/2022/08/22/docusaurusv2-prod-release"}},"content":"Lately [Q4Wine](https://github.com/brezerk/q4wine) has been my favorite Wine GUI since it\'s very\\nflexible and allows setting up and managing prefixes with specific configurations.\\nAlso [wine-ge-custom](https://github.com/GloriousEggroll/wine-ge-custom) is a custom build of Wine\\nbased on [Proton](https://github.com/ValveSoftware/Proton) meant to be used with\\nnon-Steam games outside of Steam.\\n\\n\x3c!--truncate--\x3e\\n\\nTo make a prefix use a certain Wine build first it needs to be added under\\nTools -> Wine Version Manager\\n![](https://user-images.githubusercontent.com/9277139/178163850-e7bbed07-5c6f-415c-852f-eece7202033d.png)\\nand after that is done in the Prefixes tab it can start being assigned to them."},{"id":"/2022/08/22/docusaurusv2-prod-release","metadata":{"permalink":"/techdocs/blog/2022/08/22/docusaurusv2-prod-release","source":"@site/blog/2022-08-22-docusaurusv2-prod-release.md","title":"Docusaurus 2 leaves beta","description":"On August 1st Docusarus version 2.0 was launched, the first production release after several betas.","date":"2022-08-22T00:00:00.000Z","formattedDate":"August 22, 2022","tags":[],"hasTruncateMarker":true,"authors":[{"name":"Asta86","url":"https://maybelambda.cf","imageURL":"/techdocs/img/l-logo.png","key":"lea"}],"frontMatter":{"title":"Docusaurus 2 leaves beta","authors":"lea"},"unlisted":false,"prevItem":{"title":"Using Q4Wine with wine-ge-custom and Proton","permalink":"/techdocs/blog/2023/11/07/q4wine-eggroll"},"nextItem":{"title":"Migration complete","permalink":"/techdocs/blog/2022/03/20/docusaurusv2-migration-complete"}},"content":"On August 1st Docusarus version 2.0 was launched, the first production release after several betas.\\nA few days later **Sci & Tech docs** was updated to start using it.\\n\\n\x3c!--truncate--\x3e\\n\\nThe update process from the beta 17 was pretty simple although some configuration options\\nwere moved to a different file and some CSS styles seemed to work differently on certain\\ncomponents, which required some additional small tweaks.\\n\\n[Official announcement](https://docusaurus.io/blog/2022/08/01/announcing-docusaurus-2.0)."},{"id":"/2022/03/20/docusaurusv2-migration-complete","metadata":{"permalink":"/techdocs/blog/2022/03/20/docusaurusv2-migration-complete","source":"@site/blog/2022-03-20-docusaurusv2-migration-complete.md","title":"Migration complete","description":"All the existing documents are now integrated with Docusaurus v2 and offline usage (including search) is available through the PWA.","date":"2022-03-20T00:00:00.000Z","formattedDate":"March 20, 2022","tags":[],"hasTruncateMarker":true,"authors":[{"name":"Asta86","url":"https://maybelambda.cf","imageURL":"/techdocs/img/l-logo.png","key":"lea"}],"frontMatter":{"title":"Migration complete","authors":"lea"},"unlisted":false,"prevItem":{"title":"Docusaurus 2 leaves beta","permalink":"/techdocs/blog/2022/08/22/docusaurusv2-prod-release"},"nextItem":{"title":"Migration to Docusaurus v2 started","permalink":"/techdocs/blog/2022/02/26/docusaurusv2"}},"content":"All the existing documents are now integrated with Docusaurus v2 and offline usage (including search) is available through the PWA.\\n\\n\x3c!--truncate--\x3e\\n\\nTo install the PWA (Progressive web app) simply click on the install button that shows up in the URL bar while browsing the site.\\n\\n![Install PWA button](/img/blog/install-pwa.png)\\n\\nSince the main features work well, I will continue using Docusaurus v2 exclusively for this website from now on."},{"id":"/2022/02/26/docusaurusv2","metadata":{"permalink":"/techdocs/blog/2022/02/26/docusaurusv2","source":"@site/blog/2022-02-26-docusaurusv2.md","title":"Migration to Docusaurus v2 started","description":"Started migrating the site to Docusaurus v2, which provides additional features such as offline search and dark mode.","date":"2022-02-26T00:00:00.000Z","formattedDate":"February 26, 2022","tags":[],"hasTruncateMarker":true,"authors":[{"name":"Asta86","url":"https://maybelambda.cf","imageURL":"/techdocs/img/l-logo.png","key":"lea"}],"frontMatter":{"title":"Migration to Docusaurus v2 started","authors":"lea"},"unlisted":false,"prevItem":{"title":"Migration complete","permalink":"/techdocs/blog/2022/03/20/docusaurusv2-migration-complete"},"nextItem":{"title":"New site address","permalink":"/techdocs/blog/2020/08/20/domain-change"}},"content":"Started migrating the site to Docusaurus v2, which provides additional features such as offline search and dark mode.\\n\\n\x3c!--truncate--\x3e\\n\\nHopefully it\'ll also make it easier to maintain in the long term and more secure since it uses newer libraries.\\n\\nStuff that still needs to be migrated and won\'t be available for a while:\\n\\n- Most docs.\\n- Offline version.\\n- Disqus comments."},{"id":"/2020/08/20/domain-change","metadata":{"permalink":"/techdocs/blog/2020/08/20/domain-change","source":"@site/blog/2020-08-20-domain-change.md","title":"New site address","description":"The domain name of the site was changed to maybelambda.cf. Additionally","date":"2020-08-20T00:00:00.000Z","formattedDate":"August 20, 2020","tags":[],"hasTruncateMarker":false,"authors":[{"name":"Asta86","url":"https://maybelambda.cf","imageURL":"/techdocs/img/l-logo.png","key":"lea"}],"frontMatter":{"title":"New site address","authors":"lea"},"unlisted":false,"prevItem":{"title":"Migration to Docusaurus v2 started","permalink":"/techdocs/blog/2022/02/26/docusaurusv2"},"nextItem":{"title":"Docusaurus version update","permalink":"/techdocs/blog/2020/03/31/upd-docusaurus-version"}},"content":"The domain name of the site was changed to **maybelambda.cf**. Additionally\\nDocusaurus was updated to version **1.14.6** and Disqus comments were added to\\nthe pages of the Blog posts."},{"id":"/2020/03/31/upd-docusaurus-version","metadata":{"permalink":"/techdocs/blog/2020/03/31/upd-docusaurus-version","source":"@site/blog/2020-03-31-upd-docusaurus-version.md","title":"Docusaurus version update","description":"Updated Docusaurus to version 1.14.4.","date":"2020-03-31T00:00:00.000Z","formattedDate":"March 31, 2020","tags":[],"hasTruncateMarker":false,"authors":[{"name":"Asta86","url":"https://maybelambda.cf","imageURL":"/techdocs/img/l-logo.png","key":"lea"}],"frontMatter":{"title":"Docusaurus version update","authors":"lea"},"unlisted":false,"prevItem":{"title":"New site address","permalink":"/techdocs/blog/2020/08/20/domain-change"},"nextItem":{"title":"Search enabled","permalink":"/techdocs/blog/2019/06/19/search-enabled"}},"content":"Updated Docusaurus to version **1.14.4**.\\n\\n[Release notes](https://github.com/facebook/docusaurus/releases/tag/v1.14.4)."},{"id":"/2019/06/19/search-enabled","metadata":{"permalink":"/techdocs/blog/2019/06/19/search-enabled","source":"@site/blog/2019-06-19-search-enabled.md","title":"Search enabled","description":"Search service providad by","date":"2019-06-19T00:00:00.000Z","formattedDate":"June 19, 2019","tags":[],"hasTruncateMarker":false,"authors":[{"name":"Asta86","url":"https://maybelambda.cf","imageURL":"/techdocs/img/l-logo.png","key":"lea"}],"frontMatter":{"title":"Search enabled","authors":"lea"},"unlisted":false,"prevItem":{"title":"Docusaurus version update","permalink":"/techdocs/blog/2020/03/31/upd-docusaurus-version"},"nextItem":{"title":"Migrate site to Docusaurus","permalink":"/techdocs/blog/2019/06/13/new-version-docusaurus"}},"content":"Search service providad by\\n[Algolia](https://github.com/algolia)\\nis now available. Thanks to them for allowing me to install it on my documentation site.\\n\\nIt can be used while browing the website connected to the internet."},{"id":"/2019/06/13/new-version-docusaurus","metadata":{"permalink":"/techdocs/blog/2019/06/13/new-version-docusaurus","source":"@site/blog/2019-06-13-new-version-docusaurus.md","title":"Migrate site to Docusaurus","description":"First working version of my personal documentation site built with Docusaurus.","date":"2019-06-13T00:00:00.000Z","formattedDate":"June 13, 2019","tags":[],"hasTruncateMarker":true,"authors":[{"name":"Asta86","url":"https://maybelambda.cf","imageURL":"/techdocs/img/l-logo.png","key":"lea"}],"frontMatter":{"title":"Migrate site to Docusaurus","authors":"lea"},"unlisted":false,"prevItem":{"title":"Search enabled","permalink":"/techdocs/blog/2019/06/19/search-enabled"}},"content":"First working version of my personal documentation site built with Docusaurus.\\n\\n\x3c!--truncate--\x3e\\n\\nThe previous version created using Sphinx can still be accessed\\n[here](https://lfir.gitlab.io/sci-docs)\\nalthough it is not being updated anymore."}]}')}}]);